import logo from './logo.svg';
import './App.css';
import { getPokemons } from './API';

function App() {
  try {
    getPokemons();
  } catch (error) {
    console.error(error);
  }
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://cdn.bulbagarden.net/upload/4/4b/Pok%C3%A9dex_logo.png" className="App-logo" alt="logo" />
        <p>
          Projet pokedex
        </p>
      </header>
    </div>
  );
}

export default App;
